import './Popup.css';
import Field from '../Field/Field';

function Popup(props) {

  const handlerClick = (e) => {
    e.preventDefault();
    props.transporterEvent(e.target);
  };

  return (
    <Field transporterEvent={props.transporterEvent} />
  );
}

export default Popup;
